import React from 'react';
import Image from "react-bootstrap/Image";
import Explorers from '../../src/Explorers.PNG';
import {Container, Row, Col, Button} from 'react-bootstrap'
import ExplorerHome from '../../src/ExplorerHome.png';
import Card from 'react-bootstrap/Card';
import { MDBDataTable } from 'mdbreact';

console.log(Explorers);
console.log(ExplorerHome);

const FindaGroup = () => {
  const data = {
    columns: [
      {
        label: 'State',
        field: 'state',
        sort: 'asc',
        width: 150
      },
      {
        label: 'County',
        field: 'county',
        sort: 'asc',
        width: 270
      },
      {
        label: 'Contact Name',
        field: 'contactname',
        sort: 'asc',
        width: 200
      },
      {
        label: 'Contact Email',
        field: 'contactemail',
        sort: 'asc',
        width: 100
      }
    ],
    rows: [
      {
        state: 'MI',
        county: 'Wayne',
        contactname: 'Lisa Smith',
        contactemail: 'lsmith@gmail.com'
      },
      {
        state: 'MI',
        county: 'Oakland',
        contactname: 'Mercedes Gray',
        contactemail: 'mgray123@gmail.com'
      }
    ]
  };

  return (
    <MDBDataTable
      striped
      bordered
      small
      data={data}
    />
  );
}

export default FindaGroup;
